import { useSelector, useDispatch } from "react-redux";
import { useEffect } from "react"
import {useNavigate} from "react-router-dom";

const Orders = () => {
  const user = useSelector((state) => state.user);
  const navigate = useNavigate()
  user.users[user.sessionData.email].orders.map(i => console.log(i.orderedDate + i.ID))
  useEffect(() => {
    !user.sessionData.loggedIn ? navigate("/login") : console.log()
  })
  return (
    <div className="orders">
      {user.sessionData.loggedIn ?
       <div>{user.users[user.sessionData.email].orders.map(i => <div><span className={"orderedDate"}>{i.orderedDate} </span><span className="orderedID">{i?.ID}</span></div> ) }</div>

        : <span></span> }
    </div>
  )

}

export default Orders
